import {Component} from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {

    constructor() {
        super();

        this.state = {
            monsters: [
                {
                    id: 1,
                    name: 'Linda',
                }, {
                    id: 2,
                    name: 'Frank',
                }, {
                    id: 3,
                    name: 'Jacky',
                }, {
                    id: 4,
                    name: 'Andrei',
                },
            ]
        };

    }

    render() {
        return (
            <div className="App">
                {
                    this.state.monsters.map((monster) => {
                        return <div key={monster.id}>
                            <h1>{monster.name}</h1>
                        </div>
                    })
                }
            </div>
        );
    }
}

export default App;
